  true,\n\t\"url\": null,\n\t\"notes\": \"This map is produced by the Aerial Phtography
  Field Office (APFO) to show the image acquisition dates for the 2014 National Agriculture
  Imagery Program (NAIP) imagery. The image dates are important to help the user determine
  what crops if any can be seen on the imagery. This date index contains a polygon
  for each exposure used in the creation of the imagery. To view the polygons for
  a particular state go to the boomark tab in the upper right of the map. Once a state
  is chosen the view will zoom to the state and polygons will appear. The image dates
  are a scale dependent layer both for performance and for a better user viewing experience.
  Image acquistion date, color type, camera type, camera manufacturer, camera model,
  camera hardware and firmware versions, and aircraft type are the informational fields
  contained in the map.\",\n\t\"license_title\": \"Creative Commons Attribution\",\n\t\"extras\":
